import { Link } from "react-router-dom";
import "./Nav.scss";

function Nav() {
  return (
    <div className="nav">
      <div className="nav__container">
        <h2 className="nav__header">
          <Link className="nav__link" to="/">
            Home
          </Link>
        </h2>

        <h2 className="nav__header">
          <Link className="nav__link" to="/cats">
            List
          </Link>
        </h2>
        <h2 className="nav__header">
          <Link className="nav__link" to="/cats/add">
            Upload
          </Link>
        </h2>
      </div>
    </div>
  );
}
export default Nav;
